import React from "react";
import { useNavigate } from "react-router-dom";

const Welcome = () => {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col min-h-screen justify-center items-center bg-gray-50">
      <div className="bg-white p-10 rounded shadow text-center">
        <h1 className="text-4xl font-bold mb-4 text-blue-700">Welcome to the AI Job Portal</h1>
        <p className="text-lg text-gray-700 mb-8">Find your dream job or the perfect candidate with AI-powered matching.</p>
        <div className="flex gap-6 justify-center mt-8">
          <button
            onClick={() => navigate("/login")}
            className="px-6 py-2 bg-gray-200 text-blue-700 rounded hover:bg-blue-300 text-lg font-semibold"
          >
            Login
          </button>
        </div>
      </div>
    </div>
  );
};

export default Welcome;
